  texto: |-
    aikido é uma arte marcial criada por morihei ueshiba, o o-sensei (grande mestre), cuja filosofia é fundamentada em princípios do budismo e do shintoísmo, mas principalmente no shintoísmo da seita oomoto-kyo, enquanto que suas técnicas são baseadas nas antigas formas de jujutsu.
    as técnicas são executadas em contra-ataque com movimentos circulares, propiciando a seu praticante o aproveitamento da força e do movimento do seu oponente, fazendo assim com que seu praticante não necessite do uso da própria força. as técnicas do aikido se traduzem na forma de projeções, imobilizações e torções. existe ainda o trabalho em pontos de pressão e atemi (golpe traumático), que são técnicas empregadas durante o treinamento.

    também se aprende o manejo de armas como o jo (bastão de madeira) e o bokken (espada de madeira), em conjunto com as técnicas de taijutsu (mãos livres).

    após o praticante aprender a controlar e absorver os conceitos físicos das técnicas e ter domínio sobre a parte física, gradualmente ele aprende a trabalhar com o conceito do 'ki', conectando corpo, mente e espírito com a finalidade de harmonizar-se consigo e com o companheiro de treino.
